Extract the first sentence from a documentation string.

This function handles sentences that span multiple lines by joining
consecutive non-empty lines until a sentence boundary is found.
A blank line always terminates the paragraph.

# Arguments

* `docs` - Optional documentation string

# Returns

The first sentence, or an empty string if no docs.

# Examples

```ignore
assert_eq!(extract_summary(Some("A parser. With more.")), "A parser.");
assert_eq!(extract_summary(Some("Single sentence")), "Single sentence");
assert_eq!(extract_summary(None), "");
// Handles wrapped sentences:
assert_eq!(
    extract_summary(Some("A long sentence that\nspans multiple lines. More.")),
    "A long sentence that spans multiple lines."
);
```

406.docs:
Check if an impl has associated types referencing generics NOT visible in the signature.

# The Problem

Some impl blocks have generics that only appear in associated types, not in the
visible signature. When rendered, this produces confusing output:

```text
impl DoubleEndedIterator for Foo     No `I` visible!
    type Item = <I as Iterator>::Item    Where does `I` come from?
```

# Detection Strategy

1. Extract "visible" generics from: `for_` type, trait path, where clause
2. Extract "declared" generics from: `impl_block.generics.params`
3. Compute "hidden" = declared - visible
4. Check if any associated type references a hidden generic

# Examples

```text
// FILTER THIS - `I` is hidden but used in associated type
impl<I: Iterator> DoubleEndedIterator for Foo {
    type Item = <I as Iterator>::Item;
}
visible = {}        (Foo has no generics)
declared = {I}      (from impl<I>)
hidden = {I}        (declared - visible)
assoc type uses I    FILTER!

// KEEP THIS - `T` is visible in for_ type
impl<T> Iterator for Wrapper<T> {
    type Item = T;
}
visible = {T}       (from Wrapper<T>)
declared = {T}      (from impl<T>)
hidden = {}         (all visible)
 KEEP!

// KEEP THIS - `U` is visible in trait path
impl<T, U> Trait<U> for Foo<T> {
    type Output = (T, U);
}
visible = {T, U}    (T from Foo<T>, U from Trait<U>)
declared = {T, U}   (from impl<T, U>)
hidden = {}         (all visible)
 KEEP!
```

1987.docs:
Find the most recent `.source_*` directory in the given root.

Scans for directories matching `.source_*` pattern and returns
the one with the highest timestamp (most recent).

# Arguments

* `root` - Directory to search in (typically workspace or project root)

# Returns

Path to the most recent `.source_*` directory, or `None` if not found.

# Example

```no_run
use std::path::Path;
use cargo_docs_md::source::find_source_dir;

if let Some(source_dir) = find_source_dir(Path::new(".")) {
    println!("Found source directory: {}", source_dir.display());
}
```

