1236.docs:
Generator for multi-crate search indices.

Traverses all crates in a [`CrateCollection`] and builds a comprehensive
search index of all public items (or all items if `include_private` is set).

# Example

```ignore
let crates = MultiCrateParser::parse_directory(Path::new("target/doc"))?;
let rendered_items = generator.generate();  // Returns HashMap<String, HashSet<Id>>
let generator = SearchIndexGenerator::new(&crates, false, rendered_items);
generator.write(Path::new("generated_docs/"))?;
```

2028.docs:
Extract the short name (last segment) from a qualified Rust path.

Rust paths use `::` as a separator. This function returns the final
segment, which is typically the item's simple name without module prefix.

# Examples

```
use cargo_docs_md::utils::PathUtils;

assert_eq!(PathUtils::short_name("std::vec::Vec"), "Vec");
assert_eq!(PathUtils::short_name("std::collections::HashMap"), "HashMap");
assert_eq!(PathUtils::short_name("Clone"), "Clone");
assert_eq!(PathUtils::short_name(""), "");
```

# Edge Cases

- Empty string returns empty string
- Path ending with `::` returns empty string (e.g., `"foo::"` -> `""`)
- Single segment returns itself (e.g., `"Vec"` -> `"Vec"`)

334.docs:
Categorize a trait implementation by its trait path.

This method examines the trait path and returns the appropriate category.
It handles both simple trait names (`"Clone"`) and fully-qualified paths
(`"std::clone::Clone"`).

# Arguments

* `path` - The trait path, or `None` for inherent implementations

# Returns

The [`ImplCategory`] that best matches the trait.

# Examples

```rust,ignore
// Inherent impl (no trait)
assert_eq!(ImplCategory::from_trait_path(None), ImplCategory::Inherent);

// Simple trait name
assert_eq!(ImplCategory::from_trait_path(Some("Clone")), ImplCategory::Derive);

// Fully-qualified path
assert_eq!(
    ImplCategory::from_trait_path(Some("std::clone::Clone")),
    ImplCategory::Derive
);

// Operator from std::ops
assert_eq!(
    ImplCategory::from_trait_path(Some("std::ops::Add")),
    ImplCategory::Operator
);

// Unknown trait
assert_eq!(
    ImplCategory::from_trait_path(Some("serde::Serialize")),
    ImplCategory::Other
);
```

602.docs:
Sanitize self parameter in function signatures.

Converts verbose self type annotations to idiomatic Rust syntax:
- `self: &Self`  `&self`
- `self: &mut Self`  `&mut self`
- `self: Self`  `self`

Uses `Cow<str>` to avoid allocation when no changes are needed.

# Examples

```
use cargo_docs_md::generator::render_shared::RendererUtils;

assert_eq!(RendererUtils::sanitize_self_param("self: &Self"), "&self");
assert_eq!(RendererUtils::sanitize_self_param("self: &mut Self"), "&mut self");
assert_eq!(RendererUtils::sanitize_self_param("self: Self"), "self");
assert_eq!(RendererUtils::sanitize_self_param("x: i32"), "x: i32");
```

667.docs:
Render the opening of a collapsible `<details>` block with a summary.

Produces HTML that creates a collapsible section in markdown. Use with
[`render_collapsible_end`] to close the block.

# Arguments

* `summary` - The text to display in the summary line (clickable header)

# Example

```
use cargo_docs_md::generator::render_shared::RendererInternals;

let start = RendererInternals::render_collapsible_start("Derived Traits (9 implementations)");
assert!(start.contains("<details>"));
assert!(start.contains("<summary>Derived Traits (9 implementations)</summary>"));
```

